import React from 'react';
import Badge from '@material-ui/core/Badge';
import Grid from '@material-ui/core/Grid';
import MailIcon from '@material-ui/icons/Mail';

const numbers = [
    {
        number: 23,
        color: 'primary',
    },
    {
        number: 74,
        color: 'secondary',
    },
    {
        number: 9,
        color: 'error',
    },
];

export default function BadgeExample() {
    return (
        <Grid 
            container 
            style={{
                marginTop: 20,
            }}
        >
            {numbers.map((num, index) => {
                return (
                    <Grid 
                        item 
                        xs 
                        key={index.toString()} 
                    >
                        <Badge 
                            badgeContent={num.number} 
                            color={num.color}
                            max={23}
                        >
                            <MailIcon />
                        </Badge>
                    </Grid>
                );
            })}
        </Grid>
    );
}
